import API from './Api';

export default class PersonList extends React.Component {
    handleSubmit = event => {
      event.preventDefault();
  
      API.post(`getRef.do?json={"id":"funRegistroGarantias"}`)
        .then(res => {
          console.log(res);
          console.log(res.data);
        })
    }
  }
